export const fetchCharacterName = async (baseUrl, nameStyle, nameGender, ancestryId) => {
  let url = baseUrl;
  if (nameStyle) {
    url = url.concat(`/style/${nameStyle}`);
  } else {
    url = url.concat(`/gender/${nameGender}`)
  }

  if (ancestryId > -1) {
    url = url.concat(`/${ancestryId}`);
  }

  return fetch(url, {
    method: 'get'
  }).then((res) => {
    return res.json();
  }).then((res) => {
    return res.character_name;
  });
}

export const fetchNameStyles = async (baseUrl, gameSystemId) => {
  fetch(`${baseUrl}/name_styles/${gameSystemId}`, {
    method: 'get'
  }).then((res) => {
    return res.json();
  }).then((res) => {
    return res?.name_styles;
  })
}

export const fetchNameGenders = async (baseUrl) => {
  return fetch(`${baseUrl}/genders`, {
    method: 'get'
  }).then((res) => {
    return res.json();
  }).then((res) => {
    return res.gender_options;
  })
}
